import React from 'react'
import ReactDOM from 'react-dom'

const name = 'sravani';
// const curdate = new Date().getDate();
const curdate = new Date().toLocaleDateString();
const timee = new Date().toLocaleTimeString();
const pictures = "https://picsum.photos/200/300"
const img2 = "https://picsum.photos/200/300"
const img3= "https://picsum.photos/id/237/200/300"
const re = "https://www.w3schools.com/REACT/react_jsx.asp"

ReactDOM.render(
  <React.Fragment>
<h1 contentEditable="true">hello my name is {name}</h1>
<h1 style={{color:'red'}}>current date is {curdate}</h1>
<h1>current  time is {timee}</h1>
<img src={pictures} alt="picures"/>
<img src={img2} alt="picures"/>
<a href={re} target="_blank"><img src={img3} alt="picures"/></a>
</React.Fragment>,document.getElementById('root'));
